import React from "react";
import {ServerReceive} from "./ServerReceive.js";
import {Route, BrowserRouter} from "react-router-dom";

const App = () => {
    return (
        <BrowserRouter>
            <Route path="/">
            <ServerReceive/>
            </Route>
        </BrowserRouter>

    )
}

export default App;
